import React from "react";
import {Link} from "react-router-dom";
import Card1 from "./Card1";
 

//import Flowers from ".src/images/Flowers.jpg";


const Header1=()=>{

        return(
            <>
          
        <div className="top_nav_new">
        <div className="list_new">
        <ul>
      <h1>
      <Link to="/" className="tilt_new">LOGO</Link></h1>
      <li><Link to="/Home" className="click_new">Home</Link></li>
      <li><Link to="/Discover" className="click_new">MyPorfolio</Link></li>
      <li><Link to="/Campaign" className="click_new">Clients</Link></li>
      <li><Link to="/Lists" className="click_new">Get in Touch</Link></li>
                  </ul>
      </div>
        
    </div>

    <Card1/>
     
   </>
    )
}

export default Header1;
